MongoDB date math with aggregation variable<p>I'm trying to build an aggregation of things that haven't reported in by some interval (heartbeat) - I need to calculate a value based on a stored heartbeat:</p>

<pre><code>db.things.aggregate([ 
  {$project: {"lastmsg":1, "props.settings":1}}, 
  {$unwind: "$props.settings"},
  {$project: {
    _id:0, 
    "lastmsg": "$lastmsg", 
    "heartbeat": {$multiply: [{$toInt: "$props.settings.heartbeat"},2000]},
    "now": new Date(), "subtracted": new Date(new Date().getTime()- "$heartbeat")
  }
} 
])
</code></pre>

<p>Result returned is like this:</p>

<pre><code>{ "lastmsg" : ISODate("2020-04-23T12:41:37.667Z"), "heartbeat" : 240000, "now" : ISODate("2020-05-14T16:26:11.824Z"), "subtracted" : ISODate("1970-01-01T00:00:00Z") }
{ "lastmsg" : ISODate("2020-05-14T16:24:24.228Z"), "heartbeat" : 240000, "now" : ISODate("2020-05-14T16:26:11.824Z"), "subtracted" : ISODate("1970-01-01T00:00:00Z") }
</code></pre>

<p>The "subtracted" projection is not doing the date math as expected.  I can plug in a specific number and it works but this defeats the purpose...  </p>

<p>As a last step I will match to see what of these things hasn't checked in within the interval of heartbeat:</p>

<pre><code>  { $match: { "lastmsg":{$gte: "$subtracted")}
</code></pre>

<p>Any help would be greatly appreciated...</p>

