Aggregating 3 MongoDB collections - (Python, Flask, Jinja)<p>Thanks to great help found here I managed to put in place some aggregation for 2 collections in MongoDB.</p>

<pre><code>@app.route("/perfume/&lt;id&gt;", methods=["POST", "GET"])
def perfume(id):
    perfume = mongo.db.perfumes.find_one({"_id": ObjectId(id)})
    form = AddReviewForm()
    cur = mongo.db.perfumes.aggregate(
        [
            {
                "$lookup": {
                    "from": "users",
                    "localField": "author",
                    "foreignField": "username",
                    "as": "creator",
                }
            },
            {"$unwind": "$creator"},
            {
                "$project": {
                    "_id": "$_id",
                    "perfumeName": "$name",
                    "perfumeBrand": "$brand",
                    "perfumeDescription": "$description",
                    "date_updated": "$date_updated",
                    "perfumePicture": "$picture",
                    "isPublic": "$public",
                    "perfumeType": "$perfume_type",
                    "username": "$creator.username",
                    "firstName": "$creator.first_name",
                    "lastName": "$creator.last_name",
                    "profilePicture": "$creator.avatar",
                }
            },
            {"$match": {"_id": ObjectId(id)}},
        ]
    )
    return render_template(
        "perfume.html", title="Perfumes", cursor=cur, perfume=perfume, form=form
    )
</code></pre>

<p>I now would like to add a third collection to that aggregate.</p>

<p>My goal is the following: I have now 3 collections, <code>perfumes</code>, <code>users</code> and <code>reviews</code> and I want to display in a template a perfume (a document from the perfumes collection), data from the creator (which is a document in the users collection) and data from the review (a document from the reviews collection).</p>

<p><strong>I'm currently managing to do the first two</strong>, but I'm adding the 'review perfume' functionality now.</p>

<p>Since reviewers are also users, I would like to aggregate this new collection to the current lookup.</p>

<p>This collection (reviews) has only 3 fields: <code>_id</code>, <code>review_author</code> and <code>review</code>. The <code>review_author</code> will necessarily be present in the users collection, since they have to be logged in to review.</p>

<p>I also managed to insert the <code>_id</code> of the review document (from the <code>reviews</code> collection) as an array element in the <code>perfumes</code> collection.
How's the new aggregate <code>lookup</code> I need in order to have in the template data from all three collections?
I'd be so happy to read help! </p>

<p>Currently my schemas are as follow:</p>

<pre><code>{
    "perfumes": {
        "_id": "_id",
        "author": "&lt;string&gt;",  &lt;== used to unwind with following collection
        "brand": "&lt;string&gt;",
        "name": "&lt;string&gt;",
        "perfume_type": "&lt;string&gt;",
        "description": "&lt;text field&gt;",
        "date_updated": "&lt;date&gt;",
        "public": "&lt;boolean&gt;",
        "picture": "&lt;string&gt;",
        "review": "&lt;array&gt;"
    },
    "users": {
        "_id": "_id",
        "username": "&lt;string&gt;",  &lt;== used to unwind to previous coll, needs to link to next
        "first_name": "&lt;string&gt;",
        "last_name": "&lt;string&gt;",
        "email": "&lt;string&gt;",
        "is_admin": "&lt;boolean&gt;",
        "avatar": "&lt;string&gt;"
    },
    "reviews": {
        "_id": "_id",
        "review_author": "&lt;string&gt;", &lt;== to be used as a link
        "review": "&lt;text field&gt;"
    },
}
</code></pre>

<p>Thank you!</p>

<p>UPDATE:</p>

