<p>So one user can create many perfumes. A perfume can have many reviews.
Different users can create reviews for the same or different perfumes.</p>

<p>UPDATE 2:</p>

<p>This is looking very promising and I'm super excited about it!
I'll make a short schema of what I'm aiming to do in the template:</p>

<pre><code>{% for item in cursor &amp;}
  &lt;perfume name&gt;
