  &lt;perfume review author avatar&gt;
  &lt;eventually other information&gt;
{% endfor %}
</code></pre>

<p>With the double aggregation I was achieving all of it except obviously the looping over the reviews.
Looking forward, I'm sure this is getting somewhere!! :)
P.S.: This is just very schematic to try to be clear with the idea!</p>

