<p>When querying a document via the "areaName", I only want to get the area + respective parent department + respective parent factory.</p>

<p>As an example, please briefly see the below 2 documents. </p>

<pre class="lang-js prettyprint-override"><code>db.factories.insertMany([{
  factoryName: "San Francisco",
  departments: [
