        },
        {
          areaName: "Architecture"
        }
      ]
    }
  ]
},{
  factoryName: "Chicago",
  departments: [
    {
      departmentName: "Administration",
      areas: [
        {
          areaName: "Phone Guys"
        },
        {
          areaName: "Email Guys"
        }
      ]
    },
    {
      departmentName: "Logistics",
      areas: [
        {
          areaName: "Delivery"
        },
        {
          areaName: "Human Resources"
        }
      ]
    }
  ]
}])
</code></pre>

<p>I wish to query by <code>areaName = "Architecture"</code> and receive back the following:</p>

<pre class="lang-js prettyprint-override"><code>factoryName: "San Francisco",
departments: [
   { 
      departmentName: "Development"
      areas: [
         {
            areaName: "Architecture"
         } 
      ]
   }
]
</code></pre>

<p>Since usual query combinations via .find() with projection failed (so far), I've tried myself in aggregation. 
In order to achieve the wished result, I've tried many things but failing when it comes down to filtering the areas. Filtering the departments' work.</p>

<p>Using MongoDB Compass Visual Aggregation feature, the most logical to me seemed:</p>

<pre class="lang-js prettyprint-override"><code>db.factories.aggregate([
  {
    '$match': {
      'departments.areas.areaName': 'Architecture'
    }
  }, {
    '$addFields': {
      'departments': {
        '$filter': {
          'input': '$departments', 
          'as': 'department', 
          'cond': {
            '$and': [
              {
                '$eq': [
                  '$$department.departmentName', 'Development'
                ]
              }, {
                '$filter': {
                  'input': '$$department.areas', 
                  'as': 'area', 
                  'cond': {
                    '$eq': [
                      '$$area.areaName', 'Architecture'
                    ]
                  }
                }
              }
            ]
          }
        }
      }
    }
  }
])
</code></pre>

<p>It seems a <code>$filter</code>, inside a <code>$filter</code> does not work or I'm missing something here since all 3 areas for the "Development" department are being returned instead of only "Architecture" whereas the "Development" department is being filtered correctly.</p>

<p>How can I achieve this? What am I missing?
Any help is much appreciated.</p>

<p>Many thanks!</p>

